When called with the list command, a plugin returns the list of software modules that have been installed with this plugin. $ debian-plugin list
...
{"name":"collectd-core","version":"5.8.1-1.3"}
{"name":"mosquitto","version":"1.5.7-1+deb10u1"}
... Contract: This command take no arguments. If an error status is returned, the executable is removed from the list of plugins. The list is returned using the jsonlines format. name : the name of the module. This name is the name that has been used to install it and that need to be used to remove it. version : the version currently installed. This is a string that can only been interpreted in the context of the plugin.

